import React from "react";
import { NavLink } from "react-router-dom";
import classes from './Dialogs.module.css';

const DialogItems = (props) => {
    let path = "/dialogs/" + props.id;
    return (
        <div className={classes.dialog + ' ' + classes.active}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Dialogs = () => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItems}>
                <DialogItems name="Aizhan" id="1"/>
                <DialogItems name="Aisara" id="2"/>
                <DialogItems name="Karro" id="3"/>
                <DialogItems name="Ahmad" id="4"/>
            </div>
            <div className={classes.messages}>
                <div className={classes.dialog}>Hi</div>
                <div className={classes.dialog}>How are you?</div>
                <div className={classes.dialog}>Yo</div>
            </div>
        </div>
    );
}

export default Dialogs;
